import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o as a,c as i,d as n}from"./app-f3d9d511.js";const r={},t=n('<h1 id="空间配额和回收站" tabindex="-1"><a class="header-anchor" href="#空间配额和回收站" aria-hidden="true">#</a> 空间配额和回收站</h1><h2 id="空间余量查询" tabindex="-1"><a class="header-anchor" href="#空间余量查询" aria-hidden="true">#</a> 空间余量查询</h2><h3 id="onedrive-for-business" tabindex="-1"><a class="header-anchor" href="#onedrive-for-business" aria-hidden="true">#</a> Onedrive for Business</h3><ul><li>Office 365 A1 许可证包含 1TB 空间。适用于中国学馆联盟俱乐部会员。</li><li>Microsoft 365 A3 许可证包含 5TB 空间，当 5TB 空间即将用尽时，可向我组织管理员申请扩容至 25TB。适用于中国学馆联盟学研组成员。</li></ul><p>查询地址：<code>https://xxxxxx-my.sharepoint.com/personal/yyyyyy/_layouts/15/storman.aspx</code></p><ul><li>将 xxxxxx 替代成组织的代号。</li><li>将 yyyyyy 替换成你的邮箱，标点符号使用<code>_</code>代替</li></ul><p>例如，组织代号为<code>mit</code>，邮箱为<code>davidchan@mit.edu</code>, 则其查询地址为 <code>https://mit-my.sharepoint.com/personal/davidchan_mit_edu/_layouts/15/storman.aspx</code></p><h3 id="sharepoint" tabindex="-1"><a class="header-anchor" href="#sharepoint" aria-hidden="true">#</a> Sharepoint</h3><p>通常，单个 Sharepoint 站点空间大小不限制。但是整个组织可用的空间是一定的。通常为防止 单个 Sharepoint 站点把组织的空间占满，组织管理员通常做出了限制。我组织目前不对单个 Sharepoint 站点空间大小不限制设置限制。</p><figure><img src="https://static-file.asi.ac.cn/2022/08/05/2f060fe5aa42e.png" alt="1659714105754.png" tabindex="0" loading="lazy"><figcaption>1659714105754.png</figcaption></figure><h2 id="回收站" tabindex="-1"><a class="header-anchor" href="#回收站" aria-hidden="true">#</a> 回收站</h2><p>我组织设置，删除的文件在回收站保留93天。</p><h3 id="onedrive-for-business-1" tabindex="-1"><a class="header-anchor" href="#onedrive-for-business-1" aria-hidden="true">#</a> Onedrive for Business</h3><figure><img src="https://static-file.asi.ac.cn/2022/08/05/f18aa8c24ed9e.png" alt="1659714967499.png" tabindex="0" loading="lazy"><figcaption>1659714967499.png</figcaption></figure><h3 id="sharepoint-1" tabindex="-1"><a class="header-anchor" href="#sharepoint-1" aria-hidden="true">#</a> Sharepoint</h3><p>你有时可以直接在侧边栏找到回收站，或者，点击右上角<code>齿轮</code>图标按钮，首先单击<code>网站内容</code>,最后点击<code>回收站</code>。</p><figure><img src="https://static-file.asi.ac.cn/2022/08/06/4ab5864b7e46c.png" alt="1659716344620.png" tabindex="0" loading="lazy"><figcaption>1659716344620.png</figcaption></figure>',17),o=[t];function d(s,c){return a(),i("div",null,o)}const l=e(r,[["render",d],["__file","space.html.vue"]]);export{l as default};
